window.bookSummaryJSON = "<p><i>To love him was forbidden, and it would come at a cost....</i></p> <p>Princess Cadena Winthrope was well aware of the splintering heat that sizzled her flesh whenever Gemini was nearby. As her loyal guard, Gemini remained standing in the shadows, watching her every move—his gaze catching the dark corners of the room as well as her body's outline. Past ready to face their attraction head-on, Cadena is prepared to put her heart on the line, but a romance between the two could put his life at risk. How far would they be willing to go for love?</p> <p><i>She was off-limits....</i></p> <p>Gemini is pledged by royal law to protect Cadena at all costs, even from himself, <i>even</i> from his heart. But being at her side, sunrise and sunset, had given Gemini something he wasn't expecting—a lifetime of memories transformed into picturesque scenes of their future together. Now, Gemini's loyalty is put to the test as he struggles with obeying his royal oath or giving in to his deepest desires.</p>"; 
